PROBLEM TYPE:
  PROBLEMTYPE: "Thermo"
IO:
  VERBOSITY: "Standard"
IO/RUNTIME VTK OUTPUT:
  OUTPUT_DATA_FORMAT: ascii
THERMAL DYNAMIC:
  DYNAMICTYPE: Statics
  TIMESTEP: 1
  NUMSTEP: 1
  MAXTIME: 1
  TOLTEMP: 1e-08
  LINEAR_SOLVER: 1
THERMAL DYNAMIC/RUNTIME VTK OUTPUT:
  OUTPUT_THERMO: true
  TEMPERATURE: true
  ELEMENT_OWNER: true
  ELEMENT_GID: true
  NODE_GID: true
THERMAL DYNAMIC/RUNTIME CSV OUTPUT:
  OUTPUT_THERMO: true
  ENERGY: true
SOLVER 1:
  SOLVER: "Belos"
  AZPREC: "MueLu"
  AZOUTPUT: 1
  AZREUSE: 10
  MUELU_XML_FILE: "xml/multigrid/thermo.xml"
MATERIALS:
  - MAT: 1
    MAT_Fourier:
      CAPA: 420
      CONDUCT:
        field: spatially_varying_conductivity

fields:
  - name: spatially_varying_conductivity
    discretization: "thermo"
    file: conductivity_input_field.json
    key: "CONDUCT"

FUNCT1:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "100"
FUNCT2:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "1"
DESIGN SURF DIRICH CONDITIONS:
  - E: 1
    NUMDOF: 1
    ONOFF: [1]
    VAL: [1]
    FUNCT: [1]
  - E: 2
    NUMDOF: 1
    ONOFF: [1]
    VAL: [1]
    FUNCT: [2]
